const AttributesFilterComponent = () => {
  return (
    <>
      {[{ color: ["red", "blue", "green"] }, { ram: ["1TB", "2TB"] }].map(
        (item, idx) => (
          <div>
            <Form.Label>Color</Form.Label>
            <Form.Check type='checkbox' id='default-checkbox' label='green' />
          </div>
        )
      )}
    </>
  );
};

export default AttributesFilterComponent;
